import React from "react";
import Link from "react-router-dom";

function Navbar(props) {
  return (
    <nav className="navbar bg-dark container">
      <h4>
        <Route to="/" />
        Home
      </h4>
      <h4>Create Ad</h4>
      <h4>Ads</h4>
    </nav>
  );
}

export default Navbar;
